def plot(batch_ids, set_name):
    total = len(batch_ids)
    stage_map = {}
    for id in batch_ids:
        file = f"/home/xuanda/dev/halide-pure/Halide/apps/random_pipeline/samples_new/batch_{id}/batch_stages_{id}.log"
        try:
            lines = []
            with open(file, "r") as f:
                for line in f:
                    lines.append(line)
            res = []
            mapping = set()
            for i, line in enumerate(lines):
                tokens = line.split()
                if line.find("Name: ") != -1:
                    func_name = tokens[1]
                    if lines[i - 1].find("Generated: ") != -1:
                        trimmed_line = lines[i - 1][lines[i - 1].find("Generated: "):]
                        stage_type = trimmed_line.split()[1]
                        res.append((func_name, stage_type))
                if line.find("mapping: ") != -1:
                    mapping.add(tokens[1])
            print(len(res))
            # print(mapping)
            for item in res:
                if item[0] in mapping:
                    if item[1] not in stage_map:
                        stage_map[item[1]] = 1
                    else:
                        stage_map[item[1]] += 1
        except FileNotFoundError:
            continue
    print(stage_map)

    od = collections.OrderedDict(sorted(stage_map.items()))
    stages = list(od.keys())
    values = list(od.values())
    total = 0
    for v in values:
        total += v
    precentage = []
    for v in values:
        precentage.append(v / total)
    print(f"{set_name} ", end='')
    for s, v in zip(stages, precentage):
        print(f"{s}: {v} ", end='')

    fig = plt.figure(figsize = (10, 5))

    # creating the bar plot
    plt.bar(stages, values, width = 0.4)
    
    plt.xlabel("Stage types")
    plt.ylabel("Number of occurrences")
    plt.title(f"Occurrences of random pipeline stages: {set_name}")
    fig.autofmt_xdate()
    plt.savefig(f"{set_name}.png")

plot(bad_batch_ids, "bad_pipelines")
plot(excluded_batch_ids, "excluded_pipelines")
plot(remaining_batch_ids, "remaining_pipelines")
